const ManageList = (manageList) => {
  return (
    <div className="ManageEditor-inner">
      <select>
        <option>선택</option>
      </select>
      <input
        name="kcal"
        onChange={handleChangeState}
        type="number"
        placeholder="0 kcal"
        required
      ></input>
      <input
        name="memo"
        onChange={handleChangeState}
        placeholder="메모"
      ></input>
      <p>시간</p>
      <button type="submit">확인</button>
    </div>
  );
};

export default ManageList;
